import React from 'react';

const Banner = () => {

  return(
    <div className="banner">
      <img className="img-responsive" src="https://images.unsplash.com/photo-1451187580459-43490279c0fa?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1052&q=80" alt="banner"/>
    </div>
  )
}

export default Banner;
